import React from 'react';
import './AboutContent.css';
import data from '../data/data';

function AboutContent() {
  return (
    <section className="about" id="about">
      <h1>Quem somos</h1>
      <article className="resume">
        {
        data.map((data) => <p
        key={data.id}>
          {data.about}
          </p>)
        }
        <h3
        type="about">
          Sobre n√≥s
        </h3>
      </article>
    </section>
  );
}

export default AboutContent;
